INSERT INTO `static_notifications` VALUES (1,'','Notification from admin',1,'2020-12-30 01:42:28','2021-01-12 04:19:31','2021-01-12 04:19:31'),(2,'CFI7','Did you know that smoking can cause sexual problems? It can even cause impotence.',1,'2021-01-04 00:24:22','2021-04-22 07:08:03',NULL),(3,'88Fd','There is NO safe or mild tobacco. Bidi, cigarette, hookah and chewing tobacco are all harmful. PAAN MASALA IS ALSO HARMFUL.',1,'2021-01-04 00:24:32','2021-04-22 07:08:03',NULL),(4,'6xGj','When you feel like using tobacco, try and resist for some time. Or skip entirely. Keep practising!',1,'2021-01-04 00:24:42','2021-04-22 07:08:03',NULL),(5,'BYqO','Many people use tobacco to deal with stress, tension or boredom. Try walking, exercise, yoga, deep breathing, meditation or prayer instead',1,'2021-01-04 00:24:57','2021-04-22 07:08:03',NULL),(6,'9GA9','Using any form of tobacco is HARMFUL. Tobacco causes many health problems like breathing difficulty, high blood pressure, heart attack, paralysis & cancer.',1,'2021-01-04 00:25:12','2021-04-22 07:08:03',NULL),(7,'XDSW','You may feel uneasy when you QUITthis is withdrawal. You are addicted as your body is used to tobacco. Dont worry, this goes away soon.',1,'2021-01-04 00:25:22','2021-04-22 07:08:03',NULL),(8,'2PoI','Tobacco contains nicotine which is very addictive. Use chewing gum, clove, saunf, cardamom (elaichi), to help with craving. DONT USE PAAN MASALA',1,'2021-01-04 00:53:17','2021-04-22 07:08:03',NULL),(9,'65zK','Using tobacco gives you bad breath, makes you look old and makes your hands and clothes dirty and smelly.',1,'2021-01-04 00:53:27','2021-04-22 07:08:03',NULL),(10,'KkgD','You may be restless, anxious, have sleep difficulty or constipation after QUITting tobacco. These are withdrawal symptoms & will go away soon.',1,'2021-01-04 00:53:36','2021-04-22 07:08:03',NULL),(11,'9KRo','3rd day without tobacco! Your food will taste better. Drink plenty of water to avoid constipation',1,'2021-01-04 00:53:49','2021-04-22 07:08:03',NULL),(12,'wx2z','Good that you do not miss tobacco. Stay strong and tobacco free. It is definitely worth it. You are on your way to a healthier life!',1,'2021-01-04 00:53:57','2021-04-22 07:08:03',NULL),(13,'Bgcz','Day 5! Stay positive. Do not let things get you down. The journey to a tobacco free life is definitely worth it.',1,'2021-01-04 00:54:08','2021-04-22 07:08:03',NULL),(14,'2qUf','6 days tobacco free! Exercise daily and stay active, it helps to reduce stress.',1,'2021-01-04 00:54:19','2021-04-22 07:08:03',NULL),(15,'zUTH','1 week tobacco free! Do not look back now. Feel happy and do something special today to celebrate your success!',1,'2021-01-04 00:54:32','2021-04-22 07:08:03',NULL),(16,'7SU8','Tobacco smoke is dangerous for everyone, including non-smokers who inhale this smoke. Avoid places where others are smoking',1,'2021-01-04 00:54:43','2021-04-22 07:08:03',NULL),(17,'UVTx','Avoid fried food when you have craving. Eat vegetable, salad, fruit, drink lassi, buttermilk, coconut water, chew saunf, elaichi, tulsi leaf, laung.',1,'2021-01-04 00:54:53','2021-04-22 07:08:03',NULL),(18,'GfMS','If you are bored, find something to do, so you wont feel tempted to use tobacco. Plan an outing, spend time with friends and family.',1,'2021-01-04 00:55:09','2021-04-22 07:08:03',NULL),(19,'OWrq','QUITting tobacco not only helps your lungs heal, save you from cancer but makes you healthier and stronger.',1,'2021-01-04 00:55:21','2021-04-22 07:08:03',NULL),(20,'lEbq','BREATHE DEEPLY! Inhale through nose, exhale through mouth, repeat 10 times. You can do PRANANAYAM. This will help you get over the urge for tobacco.',1,'2021-01-04 00:55:32','2021-04-22 07:08:03',NULL),(21,'u5MW','\"Energy and persistence conquer all things. This is the beginning of a new life for you. Now you know the way to succeed.',1,'2021-01-04 00:55:43','2021-04-22 07:08:03',NULL),(22,'','Admin notification',1,'2021-01-12 04:19:47','2021-01-12 04:20:14','2021-01-12 04:20:14'),(23,'3U9m','Platinum',1,'2021-02-24 05:34:24','2021-04-22 07:08:03',NULL),(24,'avbzJTbpD8a56pngvaNM7GpVvTGoGudk','Discipline is choosing between what you want now and what you want most.',1,'2021-07-20 06:02:25','2021-07-20 06:02:25',NULL),(25,'J51F9n8dqiD7tsJy7RvxYIK6aPoyXp8j','Let today be the day you give up who you\'ve been for who you can become',1,'2021-07-20 06:03:14','2021-07-20 06:03:14',NULL),(26,'yNSqAY1UngBYJRF7sCoi9BsqNT7Ycnkb','Motivation is what gets you started. Habit is what keeps you going.',1,'2021-07-20 06:03:33','2021-07-20 06:03:33',NULL),(27,'Agd3KyyKRsGsdp0DmdyW8I14elGnJnQX','Success is the sum of small efforts repeated day in and day out.',1,'2021-07-20 06:04:03','2021-07-20 06:04:03',NULL),(28,'uv40w8DQbUGxbXGeozEyEzrToG93vi7P','I have learned that champions arent just born; champions can be made when they embrace and commit to life-changing positive habits.',1,'2021-07-20 06:04:21','2021-07-20 06:04:21',NULL),(29,'4mrXrGktyK1KxMhyyldtnPqdoL6xyhzW','One day at a time.',1,'2021-07-20 06:04:49','2021-07-20 06:04:49',NULL),(30,'sF7QwqCreclEkYbTZl1jysaSHE7cJwSn','There is an island of opportunity in the middle of every difficulty.',1,'2021-07-20 06:05:06','2021-07-20 06:05:06',NULL);
